import React from 'react';

const cardStyle = {
  width: '583px', // Largura do card
  height: '533px', // Altura do card
  backgroundColor: 'rgba(176, 4, 149, 0.6)', // Cor de fundo com transparência
  borderRadius: '10px', // Borda arredondada (opcional)
  boxShadow: '0 0 10px rgba(0, 0, 0, 0.2)', // Sombra (opcional)
  padding: '20px', // Espaçamento interno (opcional)
};

const Card = () => {
  return (
    <div style={cardStyle}>
      {/* Conteúdo do card */}
    </div>
  );
};

export default Card;
